import { Suspense } from "react";
import "./App.css";
import Routes from "./routes/Routes";
import { IntlProvider } from "react-intl";
import { CookiesProvider } from "react-cookie";
function App() {
  return (
    <CookiesProvider defaultSetOptions={{ path: "/" }}>
      <IntlProvider locale="en">
        <Suspense>
        </Suspense>
      </IntlProvider>
          <Routes />
    </CookiesProvider>
  );
}

export default App;
